function calculateInverseColor(color: string) {
  // Logic to calculate the inverse color
  // For example, if the color is "#RRGGBB", you can calculate the inverse by flipping each component's value
  const invertedRed = 255 - parseInt(color.substring(1, 3), 16);
  const invertedGreen = 255 - parseInt(color.substring(3, 5), 16);
  const invertedBlue = 255 - parseInt(color.substring(5, 7), 16);

  // Convert the inverted RGB values back to a color string
  const invertedColor = `#${invertedRed
    .toString(16)
    .padStart(2, "0")}${invertedGreen
    .toString(16)
    .padStart(2, "0")}${invertedBlue.toString(16).padStart(2, "0")}`;

  return invertedColor;
}

